    a $5,000 refund received on February 18, 2009 from the Salazar for Senate committee.
    \ The refund was for a contribution made to the Salazar for Senate committee on
    September 27, 2007 by the Coors Brewing Company - Political Action by Coors Employees
    PAC (FEC ID C00032573), which was an affiliated committee of the MillerCoors LLC
    PAC.  The refund was received by the Coors Brewing Company PAC after it had transferred
    its funds to the MillerCoors LLC PAC and had closed its bank account in preparation
    for dissolving and filing a termination report.  Per the advice of Jodi Winship,
